import React from "react"
import cs from "./Contacts.module.css"


const Contacts = (props) => {

    return <div className={cs.contacts}>
        My contacts : {Object.keys(props.contacts).map(key => {
        return <Contact ContactName={key} ContactValue={props.contacts[key]}/>
    })}
    </div>
}

const Contact = (props) => {
    debugger
    return <div className={cs.contact}>
        {props.ContactValue &&
        props.ContactName} : {
        props.ContactValue &&
        props.ContactValue}
    </div>
}


export default Contacts
